export * from './src/browser';
export * from './src/search';
export * from './src/version';

import babel from 'rollup-plugin-babel';
import uglify from 'rollup-plugin-uglify';

export default [
  {
    input: 'index.js',
    output: {
      file: 'dist/index.js',
      format: 'es'
    },
    plugins: [babel()]
  },
  {
    input: 'index.js',
    output: {
      file: 'dist/concorde-browser.min.js',
      format: 'umd',
      name: 'concordeBrowser'
    },
    plugins: [babel(), uglify()]
  }
];

// This is based on jquery.client (from old WT source)
import { Search } from './search';
import { compareVersion } from './version';

export const Browser = {
  // A method to match the current browser to a list of options.
  get currentBrowser() {
    return Search.browser;
  },

  get currentPlatform() {
    return Search.platform;
  },

  get currentVersion() {
    return Search.version(this.currentBrowser);
  },

  // Return the current Browser identity (OS + Browser)
  get identity() {
    return {
      platform: this.currentPlatform.identity,
      browser: this.currentBrowser.identity,
      version: this.currentVersion.join
        ? this.currentVersion.join('.')
        : this.currentVersion
    };
  },

  // Test if this document supports touch, however... There is much
  // discussion about detecting touch in Modernizr here:
  // https://github.com/Modernizr/Modernizr/issues/548
  // We will just sniff the popular stuff for now.
  get supportsTouchEvents() {
    return (
      (this.isMobile || this.isTablet) &&
      ('ontouchstart' in window ||
        (window.DocumentTouch && document instanceof window.DocumentTouch))
    );
  },

  // This sounds pretty mobile..
  get isMobile() {
    return !!/Android|webOS|iPhone|iPod|BlackBerry|IEMobile|Opera Mini/i.test(
      navigator.userAgent
    );
  },

  /**
   * Check whether the navigation platform is an iPhone
   * @return {Boolean} Whether it is an iPhone
   */
  get isIphone() {
    return /iPhone/.test(navigator.platform);
  },

  get isTablet() {
    return /iPad/i.test(navigator.userAgent);
  },

  oneOf(lines = []) {
    if (typeof lines === 'string') {
      lines = [lines];
    }

    return lines.filter((line) => this.matches(line)).length > 0;
  },

  // Test if this is the platform you would expect
  platform(query = null) {
    return new RegExp(`${query}`, 'i').test(this.currentPlatform.identity);
  },

  isOutdated(supportedBrowsers) {
    return !this.oneOf(supportedBrowsers);
  },

  // See if our query matches our current browser (and version)
  matches(query) {
    const result = query.split(/\s+/);

    const browser = result[0];

    // does it match the browser?
    if (!new RegExp(`${browser}`, 'i').test(this.currentBrowser.identity)) {
      return false;
    }

    // No other params? Then it is finished and succesful
    if (result.length <= 1) {
      return true;
    }

    // expand the query
    const operator = result[1];
    const version = result[2];

    // Compare the versions
    return compareVersion(this.currentVersion, operator, version);
  }
};

// List of browsers and operating systems / matching patterns
export default {
  get browser() {
    return [
      {
        string: navigator.userAgent,
        subString: 'Edge/',
        identity: 'Edge',
        versionSearch: 'Edge'
      },
      {
        string: navigator.userAgent,
        subString: 'Chrome',
        identity: 'Chrome'
      },
      {
        string: navigator.userAgent,
        subString: 'OmniWeb',
        versionSearch: 'OmniWeb/',
        identity: 'OmniWeb'
      },
      {
        string: navigator.vendor,
        subString: 'Apple',
        identity: 'Safari',
        versionSearch: 'Version'
      },
      {
        prop: window.opera,
        identity: 'Opera'
      },
      {
        string: navigator.vendor,
        subString: 'iCab',
        identity: 'iCab'
      },
      {
        string: navigator.vendor,
        subString: 'KDE',
        identity: 'Konqueror'
      },
      {
        string: navigator.userAgent,
        subString: 'Firefox',
        identity: 'Firefox'
      },
      {
        string: navigator.vendor,
        subString: 'Camino',
        identity: 'Camino'
      },
      {
        // for newer Netscapes (6+)
        string: navigator.userAgent,
        subString: 'Netscape',
        identity: 'Netscape'
      },
      {
        string: navigator.userAgent,
        subString: 'MSIE',
        identity: 'Explorer',
        versionSearch: 'MSIE'
      },
      {
        // for IE11
        string: navigator.userAgent,
        subString: 'Trident/7.',
        identity: 'Explorer',
        versionSearch: 'rv'
      },
      {
        string: navigator.userAgent,
        subString: 'Gecko',
        identity: 'Mozilla',
        versionSearch: 'rv'
      },
      {
        // for older Netscapes (4-)
        string: navigator.userAgent,
        subString: 'Mozilla',
        identity: 'Netscape',
        versionSearch: 'Mozilla'
      }
    ];
  },

  get platform() {
    return [
      {
        string: navigator.platform,
        subString: 'Win',
        identity: 'Windows'
      },
      {
        string: navigator.platform,
        subString: 'Mac',
        identity: 'Mac'
      },
      {
        string: navigator.userAgent,
        subString: 'iPhone',
        identity: 'iPhone/iPod'
      },
      {
        string: navigator.userAgent,
        subString: 'iPad',
        identity: 'iPad'
      },
      {
        string: navigator.userAgent,
        subString: 'Android',
        identity: 'Android'
      },
      {
        string: navigator.platform,
        subString: 'Linux',
        identity: 'Linux'
      }
    ];
  }
};

import Config from './config';

// Find a match in the input to see if we have a known browser/platform
const filterConfig = (input) => {
  const options = input.filter((browser) => {
    if (browser.string && browser.string.indexOf(browser.subString) !== -1) {
      return true;
    } else if (browser.prop) {
      return true;
    }
  });

  if (!options.length) {
    return { identity: 'unknown' };
  }

  return options.shift();
};

// To help determine the current platform/browser/version
export const Search = {
  get platform() {
    return filterConfig(Config.platform);
  },

  get browser() {
    return filterConfig(Config.browser);
  },

  version(browser, string = false) {
    if (string === false) {
      return (
        this.version(browser, navigator.userAgent) ||
        this.version(browser, navigator.appVersion) ||
        'unknown'
      );
    }

    const search = browser.versionSearch || browser.identity;
    const index = string.indexOf(search);

    if (index === -1) {
      return false;
    }

    const version = string.substring(index + search.length + 1).split(' ');
    return version[0].split('.').map((num) => parseFloat(num));
  }
};

/**
 * Compares to versions (array format) and determines the difference between them.
 *
 * @since 1.0.0
 * @owner Version
 * @param {Array} versionA One of the versions to compare.
 * @param {Array} versionB The other version to compare.
 * @returns {number} Returns the difference.
 * @example
 *
 * diffVersions([1, 0, 0], [1, 5, 0])
 * // => -5
 *
 * diffVersions([1, 0, 0], [1, 0, 0])
 * // => 0
 *
 * diffVersions([3, 5, 1], [1, 1, 0])
 * // => 2
 */
export function diffVersions(versionA, versionB) {
  let result = -1;

  const length = versionB.length;
  for (let index = 0; index < length; index++) {
    result = versionA[index] - versionB[index];
    if (result !== 0) {
      return result;
    }
  }

  return result;
};

/**
 * Converts a string version into an array
 *
 * @since 1.0.0
 * @module Version
 * @param {String} version The version to convert, in semantic versioning format.
 * @returns {Array} Returns the version in array format.
 * @example
 *
 * versionToArray('1.0.1')
 * // => [1, 0, 1]
 *
 * versionToArray('1.0.1-alpha')
 * // => [1, 0, 1]
 *
 * versionToArray([3, 5, 1], [1, 1, 0])
 * // => 2
 */
export function versionToArray(version) {
  if (typeof version === 'string') {
    return version.split('.').map((num) => parseFloat(num));
  }

  return version;
};

/**
 * Compares to semantic versions, given an operator.
 *
 * @since 1.0.0
 * @module Version
 * @param {Array} versionA One of the versions to compare.
 * @param {String} operator Compare versions using this operator. We support `>`, `>=`, `<`, `<=`, `=` and `==`.
 * @param {Array} versionB The other version to compare.
 * @returns {boolean} True if condition can be satisfied, false otherwise.
 * @example
 *
 * compareVersion('1.0.1', '<', '5.1.0')
 * // => true
 *
 * compareVersion('4.4.1', '=', '0.1.0')
 * // => false
 *
 * compareVersion('4.4.1', '>=', '6.1.0')
 * // => false
 */
export function compareVersion(versionA, operator, versionB) {
  // Match all version parts (major, minor, patch..)
  const result = diffVersions(
    versionToArray(versionA),
    versionToArray(versionB)
  );

  // Compare the results
  switch (operator) {
    case '>=':
      return result >= 0;

    case '>':
      return result > 0;

    case '<':
      return result < 0;

    case '<=':
      return result <= 0;

    case '=':
    case '==':
      return result === 0;

    default:
      return false;
  }
};

examples:
compareVersion('1.0.1', '<', '5.1.0')
// => true

compareVersion('4.4.1', '=', '0.1.0')
// => false

compareVersion('4.4.1', '>=', '6.1.0')
// => false

